import{_ as t,c as a,o,ah as l,bI as i}from"./chunks/framework.0CRElgwM.js";const h=JSON.parse('{"title":"Download Excel Template","description":"","frontmatter":{"prev":{"text":"Site","link":"/documentation/site/site"},"next":{"text":"Scraper Data","link":"/documentation/site/site-scraper-data"}},"headers":[],"relativePath":"documentation/site/site-excel-template.md","filePath":"documentation/site/site-excel-template.md","lastUpdated":1758109585000}'),r={name:"documentation/site/site-excel-template.md"};function n(s,e,d,p,c,u){return o(),a("div",null,[...e[0]||(e[0]=[l('<h1 id="download-excel-template" tabindex="-1">Download Excel Template <a class="header-anchor" href="#download-excel-template" aria-label="Permalink to “Download Excel Template”">​</a></h1><p>Excel templates are powerful tools that allow you to prepare, organize, and manage data for automated form filling. They provide a structured format that matches your form fields, making data entry consistent and efficient.</p><h2 id="overview" tabindex="-1">Overview <a class="header-anchor" href="#overview" aria-label="Permalink to “Overview”">​</a></h2><p>Excel templates serve as the data source for your automation workflows, enabling you to:</p><ul><li><strong>📊 Organize Data</strong> - Structure your data in a familiar spreadsheet format</li><li><strong>🔄 Batch Processing</strong> - Fill multiple forms with different data sets</li><li><strong>✅ Data Validation</strong> - Ensure data consistency and accuracy</li><li><strong>📈 Scalability</strong> - Handle large volumes of data efficiently</li></ul><h2 id="prerequisites" tabindex="-1">Prerequisites <a class="header-anchor" href="#prerequisites" aria-label="Permalink to “Prerequisites”">​</a></h2><p>Before you can download an Excel template, you must have:</p><ol><li><strong>✅ Site Created</strong> - A site must be set up in the extension</li><li><strong>✅ Form Added</strong> - At least one form must be added to the site</li><li><strong>✅ Fields Configured</strong> - Form fields must be properly configured</li><li><strong>✅ Field Types Set</strong> - Each field must have a defined field type</li></ol><blockquote><p><strong>⚠️ Important:</strong> Excel templates can only be generated when form fields are present and properly configured. The template structure is automatically generated based on your field configurations.</p></blockquote><h2 id="how-to-download-excel-template" tabindex="-1">How to Download Excel Template <a class="header-anchor" href="#how-to-download-excel-template" aria-label="Permalink to “How to Download Excel Template”">​</a></h2><h3 id="step-by-step-process" tabindex="-1">Step-by-Step Process <a class="header-anchor" href="#step-by-step-process" aria-label="Permalink to “Step-by-Step Process”">​</a></h3><ol><li><p><strong>Navigate to Site Management</strong></p><ul><li>Open the extension options page</li><li>Select your target site from the site list and click site <strong>edit</strong> button</li></ul></li><li><p><strong>Access Template Download</strong></p><ul><li>Look for the <strong>Upload Excel</strong> section and click</li><li>Click on the <strong>Download Excel Template</strong> button</li></ul></li><li><p><strong>Template Generation</strong></p><ul><li>The extension automatically generates a template based on your form fields</li><li>Each configured field becomes a column in the Excel file</li><li>Sample data is included to guide proper formatting</li></ul></li><li><p><strong>Download Complete</strong></p><ul><li>The Excel file is downloaded to your default download folder</li><li>File naming follows the pattern: <code>[SiteName]_Template_[Date].xlsx</code></li></ul></li></ol><img src="'+i+'" width="350" height="350" alt="Download Excel Template Interface"><h2 id="troubleshooting" tabindex="-1">Troubleshooting <a class="header-anchor" href="#troubleshooting" aria-label="Permalink to “Troubleshooting”">​</a></h2><h3 id="❌-common-issues" tabindex="-1">❌ Common Issues <a class="header-anchor" href="#❌-common-issues" aria-label="Permalink to “❌ Common Issues”">​</a></h3><p><strong>Issue:</strong> Template not downloading <strong>Solutions:</strong></p><ul><li>Ensure all form fields are properly configured</li><li>Check if the site has at least one form</li><li>Verify browser download permissions</li><li>Try refreshing the extension options page</li></ul><p><strong>Issue:</strong> Template missing columns <strong>Solutions:</strong></p><ul><li>Verify all fields are configured with proper field types</li><li>Check if fields are set to active status</li><li>Regenerate the template after field updates</li></ul><h2 id="integration-with-automation" tabindex="-1">Integration with Automation <a class="header-anchor" href="#integration-with-automation" aria-label="Permalink to “Integration with Automation”">​</a></h2><h3 id="🔄-workflow-integration" tabindex="-1">🔄 Workflow Integration <a class="header-anchor" href="#🔄-workflow-integration" aria-label="Permalink to “🔄 Workflow Integration”">​</a></h3><ol><li><strong>Download Template</strong> - Get the latest template structure</li><li><strong>Fill Data</strong> - Enter your data following the guidelines</li><li><strong>Upload Data</strong> - Use the upload feature to import data</li><li><strong>Run Automation</strong> - Execute the automated form filling</li></ol><h2 id="next-steps" tabindex="-1">Next Steps <a class="header-anchor" href="#next-steps" aria-label="Permalink to “Next Steps”">​</a></h2><p>After downloading your Excel template:</p><ul><li><a href="/documentation/site/site-excel-template.html">Upload Excel Template</a> - Learn how to upload filled templates</li><li><a href="/documentation/form-fields/field.html#insert-field">Form Field Configuration</a> - Configure individual form fields</li><li><a href="/documentation/form-fields/field-types.html">Field Types Guide</a> - Understand different field types</li><li><a href="/documentation/structure.html">Automation Workflow</a> - Set up complete automation workflows</li></ul><h2 id="tips-and-tricks" tabindex="-1">Tips and Tricks <a class="header-anchor" href="#tips-and-tricks" aria-label="Permalink to “Tips and Tricks”">​</a></h2><h3 id="💡-pro-tips" tabindex="-1">💡 Pro Tips <a class="header-anchor" href="#💡-pro-tips" aria-label="Permalink to “💡 Pro Tips”">​</a></h3><ol><li><strong>Start Small</strong> - Test with a few rows before bulk processing</li><li><strong>Keep Backups</strong> - Regular backups of your data and templates</li></ol><h2 id="support-and-help" tabindex="-1">Support and Help <a class="header-anchor" href="#support-and-help" aria-label="Permalink to “Support and Help”">​</a></h2><p>If you need assistance with Excel templates:</p><ul><li>Check the <a href="/documentation/log.html">Log</a> for detailed error information</li><li>Review <a href="/documentation/form-fields/field-types.html">Field Types</a> for configuration help</li><li>Visit our <a href="/documentation/#need-help">Support Channels</a> for community assistance</li><li>Report issues on our <a href="https://github.com/jeevan-lal/excellent-data-filler-docs/issues" target="_blank" rel="noreferrer">GitHub Repository</a></li></ul>',31)])])}const f=t(r,[["render",n]]);export{h as __pageData,f as default};
